import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from 'react';
import logo from '../Images/Gyaan setu.png';
import './first.css';
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowUpRight } from '@fortawesome/fontawesome-svg-core';

library.add(faArrowUpRight);


export default function Start() {
  

  return (
    <>
    <div>
        <div className='Head'>GYAAN SETU</div>
         <hr className='line' />
         <img className='Logo' src={logo}/>
    </div>
    <div className='JoinCom'>
        <p className='Join'>Join Our Community</p>
        <span className='TakeNotes'>Take Notes By </span> 
        <span className='deleting'>Deleting </span>
        <span className='Them'>Them!</span>
    </div>
    <div className='TryIt'>
        <button className='TryGyaanSetu'>Try Gyaan Setu 
          <FontAwesomeIcon icon="arrow-up-right-from-square" className="ArrowUp"/>
        </button>
    </div>
</>
  );
}
